import ubinascii, os, machine,uhashlib
from ubinascii import hexlify

encoded=(('pyhuskylens.mpy', ('\n', '\n', '\n', '\n', '\n'), 'b7f678b76ccb89e55819dbde457a0d9c3b247bb640b2f1c80049d9e3e544e212'), ('rc.mpy', ('\n', '\n'), '5a1d3530b6cc7b48e32a03c8657de18e6250f68db1665e568c67ba0d6529f1fe'), ('light.mpy', ('\n', '\n', '\n', '\n'), '11e13f0a9ac99b56f28402bca9c05788a59700e0f5d8512548116460e97f6544'), ('__init__.mpy', ('TQUCHyAkAAoABzwuLi9tcHlfcm9ib3RfdG9vbHMvX19pbml0X18ucHkAUWMAAA==\n',), 'bd0eb1ec00392c81347ab95950ebc33661aa1cb23009054638ed4cbea66fcc3e'), ('bt.mpy', ('\n', '\n', '\n', '\n', '\n', '\n', '\n', '\n', '\n'), '91fb2baa7cdaa12aae4eba7d896c22f26517660c13809cad3625c0c364a4f609'), ('uartremote.mpy', ('\n', '\n', '\n', '\n', '\n', '\n'), 'f812bfcee402f8cd0df49c37704e208ed75333054d2d4cf9f9d55435ffd911dd'), ('ctrl_plus.mpy', ('\n', '\n', '\n'), '755e50bef444102272dc68fb20d8e697c139bc2275f2a5dcffd3bd4ddd93cde7'), ('helpers.mpy', ('\n',), '484861e26a6633fad32f8658dabbfff5dd54fae05ba1ddc2af7b5ee5bbed956f'), ('motor_sync.mpy', ('\n', '\n', '\n'), '7a0d139266d540d5865712a8668b07cf32eb81480bcb6f05522f8067127d1e38'))

def calc_hash(b):
    return hexlify(uhashlib.sha256(b).digest()).decode()

error=False
try:
    os.mkdir('/projects/mpy_robot_tools')
except:
    pass

for file, code, hash_gen in encoded:
    print("Writing file ", file)
    # hash_gen=code[1]
    target_loc = '/projects/mpy_robot_tools/'+file
    
    print('writing '+file+' to folder /projects/mpy_robot_tools')
    with open(target_loc,'wb') as f:
        for chunk in code:
            f.write(ubinascii.a2b_base64(chunk))
    del code

    try:
        print('Finished writing '+file+', Checking hash.')
        result=open(target_loc,'rb').read()
        hash_check=calc_hash(result)

        print('Hash generated: ',hash_gen)

        if hash_check != hash_gen:
            print('Failed hash of .mpy on SPIKE: '+hash_check)
            error=True
    except Exception as e:
        print(e)


if not error:
    print('Library written succesfully. Resetting....')
    machine.reset()
else:
    print('Failure in writing library!')